// src/App.js

import React from 'react';
import './App.css';
import CreateBooking from './components/CreateBooking';
import BookingList from './components/BookingList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>LIC Reservation System</h1>
        <CreateBooking />
        <BookingList />
      </header>
    </div>
  );
}

export default App;
